import React from "react";

const Student = ({
  stu: {
    id,
    attributes: { name, gender, age, address },
  },
}) => {
  return (
    <tr>
      <td>{name}</td>
      <td>{gender}</td>
      <td>{age}</td>
      <td>{address}</td>
      <td>
        <button>删除</button>
      </td>
    </tr>
  );
};

export default Student;
